'''Gold key black''' is a key and reward from the [[Shades of Mort'ton (minigame)|Shades of Mort'ton]] minigame. To obtain it, the player must kill an [[Urium Shade]] and then burn its [[Shade remains|remains]] on a pyre. The key may be used to enter the [[Shade Catacombs]] and then open the correctly coloured chest. It will open a [[Gold Chest (black)|gold-framed chest with a black lock]]. This type of key can be used to open any door within the tombs, giving the player unrestricted access to all areas.

